def nodal_velocity(mesh):
    """Compute nodal velocity as :math:`v = mv / m`.

    Arguments:
        mesh: mesh
            a mesh object
    """
    for node in mesh.nodes:
        if(node.mass > 0.):
            node.velocity = node.momentum / node.mass

def nodal_momentum(mesh):
    """
    Update nodal momentum :math:`(mv)_i = \sum_p N_i(x_p) * m_p * v_p`.

    Arguments:
        mesh: mesh
            a mesh object
        dt: float
            time step
    """
    for node in mesh.nodes:
        node.momentum = 0
    for el in mesh.elements:
        for prtcl in el.particles:
            for i in range(el.nnodes):
                el.nodes[i].momentum += prtcl.mass * prtcl.velocity * prtcl.shapefn[i]

def reset_nodal_values(mesh):
    """Reset nodal values at the end of the iteration. Reset mesh.
    """
    for node in mesh.nodes:
        node.reset_values()

def particle_velocity(mesh, dt):
    """
    Compute particle velocity transfer nodal velocity to particle. :math:`v_p += \sum_i N_i(x_p) * {f_{total}}_i/m_i * dt`.

    Arguments:
        mesh: mesh
            a mesh object
        dt: float
            time step
    """
    for el in mesh.elements:
        for prtcl in el.particles:
            for i in range(el.nnodes):
                prtcl.velocity += el.nodes[i].f_total/el.nodes[i].mass * prtcl.shapefn[i] * dt

def particle_position(mesh, dt):
    """
    Compute particle position based on nodal momentum to particle. :math:`x_p += \sum_i N_i(x_p) * {mv}_i/m_i * dt`.

    Arguments:
        mesh: mesh
            a mesh object
        dt: float
            time step
    """
    for el in mesh.elements:
        for prtcl in el.particles:
            for i in range(el.nnodes):
                prtcl.x += el.nodes[i].momentum/el.nodes[i].mass * prtcl.shapefn[i] * dt

def mass_momentum_to_nodes(mesh):
	"""Map mass and momentum of particles in the elements to the associated nodes.

        Args:
            mesh: mesh object with nodes, elements and particles
	"""
	for el in mesh.elements:
		for par in el.particles:
			for i in range(len(el.nodes)):
				el.nodes[i].mass += par.mass * par.shapefn[i]
				el.nodes[i].momentum += par.mass * par.shapefn[i] * par.velocity

def body_force_to_nodes(mesh, gravity):
	"""Compute body force at the nodes. The external force :math:`f_{ext} = \sum_i N_i * m_p * g`.

        Args:
            mesh: mesh object with nodes, elements and particles
	"""
	for el in mesh.elements:
		for par in el.particles:
			for i in range(len(el.nodes)):
				el.nodes[i].f_ext += par.mass * par.shapefn[i] * gravity

def internal_force_to_nodes(mesh):
	"""Map internal force to nodes. The nodal stresses are mapped to the nodes as internal force. The nodal internal force :math:`f_{int} = -\sum_i dN_i \sigma_p m_p / P_p`.

        Args:
            mesh: mesh object with nodes, elements and particles	
	"""
	for el in mesh.elements:
		for par in el.particles:
			for i in range(len(el.nodes)):
			     el.nodes[i].f_int -= par.dn_dx[i] * par.stress * par.mass / par.density

def external_force_to_nodes(mesh):
	"""Map external force of the particles to the nodes. The nodal external force :math:`f_{ext} = \sum_i N_i * {f_{ext}}_p`.

        Args:
            mesh: mesh object with nodes, elements and particles	
	"""
	for el in mesh.elements:
		for par in el.particles:
			for i in range(len(el.nodes)):
			     el.nodes[i].f_ext += par.shapefn[i] * par.f_ext
